ホロライブの白上フブキ（
@shirakamifubuki
)がhttp://ASCII.jpさんの記事で紹介されております。
"マイクラで共同生活するVTuberたち～白上フブキとベルモンド・バンデラスの場合"

赤井はあとちゃんの3D初放送をご覧頂きありがとうございました！今回の放送は 
@headless_aki
 さんが制作された3Dモデルをホロライブ のシステムに合わせて調整して、使用させて頂きました。ご協力頂きありがとうございました！

